import React from "react"

function Educationals( { techArray }) {
    return (
        <section className="techBlurbsSection">
            {
            techArray.map((tech) => 
                <div key={tech.name} className="blurb">
                    <img src={tech.img} alt={tech.altText} className={((tech.name).toLowerCase())}></img>
                    <h5>{tech.name}</h5>
                    <p>{tech.description}</p>
                    <input type={"button"} value="See Degrees" />
                </div>
                )
            }
        </section>
        )
}

export { Educationals }
